> Top News Miami-FSU tee it up; NW-Michigan, Cal-Utah in league games FILE - In this Nov. 16, 1991, file photo, Miami's Jesse Mitchell (79) celebrates as Florida State kicker Gerry Thomas (15) leaves the field after missing a field goal in the closing seconds of an NCAA college football game in Tallahassee, Fla. New coaches, new players, new era, but the 'Canes (3-1) and 12th-ranked 'Noles (4-0) tee it up again on Saturday, Oct. 10, 2015, with Florida State looking to make it five wins in a row over Miami. (AP Photo/Don Dughi, File) 
